import { useState } from 'react';





function Navbar () {


    const [isLoading, setIsLoading] =  useState(false);

    localStorage.setItem("userId", "123");


    const handleClick = async () => {

        const userId = localStorage.getItem("userId")
        setIsLoading(true);

        try {
            console.log("TEST!");
            //Add ID to POST


            await fetch("http://localhost:5001/api/contract-checker/post-contractAiStart", {
                method: "POST",
                headers: {
                  "Content-Type": "application/json",
                },
                body: JSON.stringify({ selectionSoftwareProductDocumentId: userId }),
              });

              console.log("AI triggered")

        } catch (error) {

            console.log("Error:", error)

        } finally {
            setIsLoading(false)
            console.log("Done")
        }
    };



    return (

        <nav className="bg-white h-16 flex items-center justify-between px-4  border-b-2 border-primary2">
            <div className="flex flex-row items-center gap-6">
                <h2 className="font-sans text-sm">Date created: 3.3.2025 </h2>
                <h2 className="font-sans text-sm">contract.pdf</h2>
            </div>
            <div>
                <button onClick={handleClick} disabled={isLoading} className={`${isLoading ? 'bg-gray-400' : 'bg-black'} w-48 h-10 rounded-lg text-white font-sans`}>Ai Analyze</button>
            </div>
        </nav>
        )
}

export default Navbar;
